import "./singlePost.css"

export default function SinglePost() {
  return (
    <div className="singlePost">
      <div className="singlePost">
        <div className="spWrapper">
          <img src="https://img.okezone.com/content/2015/01/14/46/1091906/hanya-messi-yang-berhak-tentukan-masa-depannya-YXPTNjDvSx.jpg" alt="" className="spImage" />
        </div>
      </div>
    </div>
  )
}
